import React from "react";
import '../css/navbar.css';


function Navbar() {
  return (
    <div class="sidenav">
      <img className="logo-nav" src=""/>
      <a href="#about">About</a>
      <a href="#services">Services</a>
      <a href="#clients">Clients</a>
      <a href="#contact">Contact</a>
    </div>

  );
}

export default Navbar;
